import React from "react";
import Cape from '../../images/logo.gif';

const Footer = () => (
  <footer className="bg-light p-3 text-center">
    <div><Cape /></div>
    <p>
      Sample project provided by <a href="https://auth0.com">Auth0</a>
    </p>
  </footer>
);

export default Footer;
